import React from "react";

const UserHasNoFavorites = () => {
  return (
    <div className='noFavoritesMainDiv'>
      <h1>No favorites here!</h1>
      <h1>Go To</h1>
      <div className='noFavoritesButtonsDiv'>
        <button className='mainPageButtons'>Home</button>
        <button className='mainPageButtons'>Movies</button>
      </div>
    </div>
  );
};

export default UserHasNoFavorites;
